import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useState } from 'react';
import Register from './auth/Register';
import Login from './auth/Login';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Adminlogin from './auth/Adminlogin';
import Superadmin from './auth/Superadmin';
import Footer from './Footer/Footer';
import Usermain from './Components/Usermain.jsx';
import Superadminmain from './Components/Superadminmain.jsx';
import Adminmain from './Components/Adminmain.jsx';

function App() {

  return ( 
    <>  
    <div class="area" >
            <ul class="circles">
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
            </ul>
    <div class="context">
    <Router>

        <Routes>
        <Route path='/user-main' element={<Usermain/>}/>
        <Route path='/superadmin-main' element={<Superadminmain/>}/>
        <Route path='/admin-main' element={<Adminmain/>}/>
        <Route path='/superadminlogin' element={<Superadmin/>}/>
        <Route path='/adminlogin' element={<Adminlogin/>}/>
        <Route path="/register" element={<Register/>}/>
        <Route path="/login" element={<Login/>}/>  

        </Routes>
        <Footer/>
      </Router>
    </div>
    </div >
    </>
  );
}

export default App;
